import { Card, Paper } from '@material-ui/core'
import React from 'react'

export default function PageHeader(props){

    const { title, subtitle, icon}=props;
    return (
        <Paper elevation={0} square>
            <div>
                <Card>
                   {icon}
                </Card>
            </div>
        </Paper>
    )
}
